        HTTPClientPolicy cp = hc.getClient();
        cp.setDecoupledEndpoint(("http:example.com"));
        out = new OutMessageRecorder();
        in = new InMessageRecorder();
        greeterBus.getOutInterceptors().add(out);
        greeterBus.getInInterceptors().add(in);
